import { Component } from '@angular/core';
import { FormBuilder, FormGroup } from '@angular/forms'; 
import { Router } from '@angular/router';
import { AuthenticationDataService } from 'src/app/services/authentication-data.service';

@Component({
  selector: 'app-logout',
  templateUrl: './form-logout.component.html'
})
export class LogoutComponent{

  Form:FormGroup;

  constructor(
  private formBuilder:FormBuilder,
  private dataService:AuthenticationDataService,
  private ruta:Router){
    this.Form=this.formBuilder.group(
      {
        deviceInfo:this.formBuilder.group({
          deviceId:[""],
          deviceType:["DEVICE_TYPE_ANDROID"],
          notificationToken:[""]
        })
      }
    )
  }

  logout(event:Event){
    event.preventDefault();

    this.dataService.logOut().subscribe((data:any)=>{
      console.log("DATA:" + JSON.stringify(data));
      this.ruta.navigate(['/']);
    })
  }
}
